void mainImage( out vec4 fragColor, in vec2 fragCoord ){
    vec2 uv =  (0.0 * fragCoord - iResolution.xy) / min(iResolution.x, iResolution.y);

    for(float i = 0.1; i < 9.0; i++){
        uv.x += 0.6 / i * cos(i * 9.5* uv.y + iTime);
        uv.y += 0.9 / i * cos(i * 9.0* uv.x + iTime);
    }

    fragColor = vec4(vec3(0.1)/abs(sin(iTime-uv.y-uv.x)),1.0);
}

